    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE NOT - col2 + - 50 * 29 * + 60 = - - 24 * + col1 + + col0;
  - name: tab1

outputs:
  - name: q7544.out
    data: |
      51	14	96
      85	5	59
      91	47	68
